import React, { Fragment } from 'react';

import { makeStyles } from '@material-ui/core/styles';
import { List, ListItem, ListItemIcon, ListItemText, Divider, Icon, Typography } from '@material-ui/core';

const useStyles = makeStyles(theme => ({
    root: {
        width: '100%',
        maxWidth: 360,
        backgroundColor: theme.palette.background.paper,
    },
    secondary: {
        display: 'inline',
    },
}));

function About() {

    const classes = useStyles();

    return (
        <Fragment>
            <div className="col-4">
                <List component="nav">
                    <ListItem button>
                        <ListItemIcon>
                            <Icon>contacts</Icon>
                        </ListItemIcon>
                        <ListItemText primary="Contact Info" />
                    </ListItem>
                    <ListItem button>
                        <ListItemIcon>
                            <Icon>school</Icon>
                        </ListItemIcon>
                        <ListItemText primary="Work and Education" />
                    </ListItem> 
                </List>
            </div>
            <div className="col-8">
                <List>
                    <ListItem alignItems="flex-start">
                        <ListItemText 
                            primary="Education"
                            secondary={
                                <Fragment>
                                    <Divider variant="inset" />
                                    <Typography className={classes.secondary} component="span" variant="body2" color="primary">
                                        Central Piedmont Community College
                                    </Typography>
                                </Fragment>
                            }
                        />
                    </ListItem>
                </List>
            </div>
        </Fragment>
    );
}

export default About;
